import Movie from "./Movie"; // Import the Movie component

function Home({ Data }) {
  return (
    <div className="movie-container mt-5">
      <h2>Home</h2>
      <Movie Data={Data} /> {/* Render the Movie component */}
    </div>
  );
}

export default Home;
